window.bookSummaryJSON = "<p>America. The land of the free. Unless you're a latent.</p> <p>Kage is missing. Alexander Kempthorne would prefer he stay that way. Life at the new-look Kempthorne &amp; Co agency is difficult enough without adding a missing American to the mix. But John \"Dom\" Domenici won't abandon someone who was once their friend, even if Kage is \"technically\" an enemy.</p> <p>But as the team investigate Kage's disappearance, a traumatic, hidden past comes to light. And a missing person case soon turns into a fight for survival for Dom and Kempthorne, in a land not-so-free.</p> <p>Contains mature themes.</p>"; 
